      <a href="#" style={{ marginRight: '10px', color: 'white' }}>Inicio</a>
      <a href="#" style={{ marginRight: '10px', color: 'white' }}>Productos</a>
      <a href="#" style={{ color: 'white' }}>Contacto</a>
      <CartWidget />
    </nav>
  );
}

